VALUES('23-007880', 'Email RAPP Report 3rd report to RAPP by Bylaw Services regarding the feeding and placement of wildlife attractants ( raw meat) on their back deck railing. Public concerns reported in September 21,2022, December 20,2022 March 25,2023. Officer visited the restaurant in September 2022, saw the bits of meat debris left and the crows circling the railing and a lot of animal attractants such as improper grease disposal (an open bucket on his deck) grease rags hanging from his railing. We notified owner he cannot do that as it is a wildlife violation both a Bylaw and a Wildlife Act . Public report in December occurred during our holiday hours so no staff was available to address. March 25th 2023 report from member of the public with photos again of the crows sitting all over the back railing eating the raw meat he leaves out. Public reports he throws meat off his deck for the wildlife ( that we cannot confirm). He has received a warning from us and now a MTI of 50$ is being issued regarding infraction. Requesting assistance in regard to infraction of Wildlife Act and failure to comply in spite previous warning. ', 'Alec', '127 fake st', NULL, '555-555-5557', NULL, NULL, NULL, NULL, '2023-04-03 07:24:00.000', '2023-04-02 07:24:00.000', NULL, 'FLYWAY', '2023-06-29 22:16:16.754', 'FLYWAY', '2023-06-29 22:16:16.754', NULL, 'COS', 'OPEN', 'KINABSKT', 'SRID=4326;POINT (0 0)'::geometry)
