INSERT INTO complaint
(complaint_identifier, detail_text, caller_name, caller_address, caller_email, caller_phone_1, caller_phone_2, caller_phone_3, location_summary_text, location_detailed_text, incident_utc_datetime, incident_reported_utc_timestmp, reported_by_other_text, create_user_id, create_utc_timestamp, update_user_id, update_utc_timestamp, reported_by_code, owned_by_agency_code, complaint_status_code, geo_organization_unit_code, location_geometry_point)
VALUES('23-007878', 'Email RAPP Report Teck Highland Valley Copper Partnership (HVC) -Highmont Creek: NAD 83 Zone 10U 5591804N, 642238E March 27, 2023 Potential fish mortality  During a qualified professional (QP) inspection of infrastructure it was noted that there was no screen to prevent fish from entering the Highmont Creek Diversion, a pipeline that transports contact water to the mill for process. Highmont Creek is located within the mine footprint to the east of the Mill, administration buildings and Valley South Dump. Highmont Creek has been altered during historic mining practices and is bound by historic rock dumps along the west side and upstream ends of the watercourse. An isolated, remnant fish population of Rainbow Trout exists in roughly 2.26 km of the downstream end of Highmont Creek, upstream of the Diversion infrastructure. During extreme weather events HVC has approval under their Environmental Management Act (EMA) Effluent Permit PE-376, to discharge to environment.No fish mortalities have been observed but there is a possibility for fish to be swept downstream into the Diversion pipeline. HVC has reviewed several options on how to prevent fish from entering the Highmont Creek diversion to remain in compliance with the Fisheries Act. Installation of an end of pipe fish screen is not feasible, as flows into the pipeline would require a large amount of maintenance to keep clean to allow flows to enter the pipe and the high potential of fish to be impinged on the fish screen during high flow events. Electrical barrier option can be left instream during open water season, no physical structure to clean, safety consideration and area would need to be isolated, power source, cost and maintenance would deem this option not feasible for this system. Bubbler system was also evaluated but may not be effective in turbulent water or high flow events, maintenance and a power source also deem this option not feasible. Fish removal was also evaluated as an option. Logistically this option would be the best solution but would need to consider time constraints for meaningful engagement with Indigenous Government and Organizations and regulators, regulatory considerations for permits, Fisheries Act authorization application and offsetting, and the HVC2040 project ', 'Steve', '125 fake st', 'test@gmail.com', '555-555-5555', '555-555-5568', NULL, NULL, NULL, '2023-04-01 07:24:00.000', '2023-03-31 07:24:00.000', NULL, 'FLYWAY', '2023-06-29 22:16:16.754', 'FLYWAY', '2023-06-29 22:16:16.754', NULL, 'COS', 'OPEN', 'JAFFRAY', 'SRID=4326;POINT (0 0)'::geometry)
ON CONFLICT DO NOTHING;
