(complaint_identifier, detail_text, caller_name, caller_address, caller_email, caller_phone_1, caller_phone_2, caller_phone_3, location_summary_text, location_detailed_text, incident_utc_datetime, incident_reported_utc_timestmp, reported_by_other_text, create_user_id, create_utc_timestamp, update_user_id, update_utc_timestamp, reported_by_code, owned_by_agency_code, complaint_status_code, geo_organization_unit_code, location_geometry_point)
VALUES('23-007875', 'On Mar 28, 2023 at 1645 hrs I observed Lean Bean Miller''s truck (see photo) hauling a load of poultry slaughter waste along Doran Rd heading north to Hillbank Rd. I have followed this truck in past from the Island Farmhouse Poultry facility to 4035 Hillbank Road and can attest that this is the route this truck takes to dump its loads of slaughter waste. Last month both Island Farmhouse Poultry Ltd. and GT Farms were told by the Ministry to ''Immediately cease disposing of any processing waste that comes from poultry not reared, kept or slaughtered at Miller properties.'' The most recent Ministry Inspection reports, UA202814 and AG144737, both stated that this unauthorized waste disposal must be ceased immediately. Its time for the Ministry to involve the Conservation Officer Service and to start taking regulations enforcement seriously. ', 'Dalton Campbell', '1234 Doran Road, Cobble Hill, BC V0R 1L5 ', 'dalton.campbell@shaw.ca', '250-743-1331', NULL, NULL, 'Houston Road', 'In a Van down by the River', '2023-03-29 07:24:00.000', '2023-03-29 07:24:00.000', 'Caller', 'FLYWAY', '2023-06-29 22:16:16.754', 'FLYWAY', '2023-06-29 22:16:16.754', 'OTHER', 'COS', 'OPEN', 'JOHNSNLG', 'SRID=4326;POINT (-127.4810142 50.4217838)'::geometry)
ON CONFLICT DO NOTHING;
