	 ('23-007000','RCMP relaying a report of a deer stuck in the COM’s tree. Deer’s hoof is caught in the V, deer is dangling upside down – believe shoulder is dislocated. LVM Sgt Melenka Briefed CO Krenz','Dorothy Ann','435 Fake St','test@gmail.com',NULL,NULL,NULL,NULL,'detailed text 4','2022-12-23 08:57:00','2023-01-10 09:12:00',NULL,'FLYWAY','2023-07-26 19:25:34.66322','FLYWAY','2023-07-26 19:25:34.66322','BCWF','COS','OPEN','ALZLK','SRID=4326;POINT (0 0)'),
	 ('23-007001','Calling to report a black bear that comes through the area at night. It has been getting into garbages that have been left unsecured. Hoping a CO can come round to advise neighbour''s that they need to get their garbages locked up.','Annonymous','433 Fake St',NULL,NULL,NULL,NULL,'373 Front Street','detailed text 2','2022-12-27 09:03:00','2023-01-08 09:12:00',NULL,'FLYWAY','2023-07-26 19:25:34.66322','FLYWAY','2023-07-26 19:25:34.66322',NULL,'COS','OPEN','BDNSTLK','SRID=4326;POINT (0 0)'),
	 ('23-007002','Calling to report a young deer, looked to be struggling to stand and walk but still mobile. Possibly hit by a car.',NULL,'432 Fake St',NULL,NULL,NULL,NULL,'Kanaka Station Rd','detailed text 1','2022-12-29 09:06:00','2023-01-07 09:12:00',NULL,'FLYWAY','2023-07-26 19:25:34.66322','FLYWAY','2023-07-26 19:25:34.66322',NULL,'COS','OPEN','CLUCLZLK','SRID=4326;POINT (0 0)'),
	 ('23-007003','COM reporting she saw a bobcat when checking on her property 2 days ago.','Joanne Jackson','1234 Merritt Avenue',NULL,'250-315-1234',NULL,NULL,'unit 8 1226 McMillan Rd, Merritt, BC',NULL,'2022-12-31 09:09:00','2023-01-06 09:12:00',NULL,'FLYWAY','2023-07-26 19:25:34.66322','FLYWAY','2023-07-26 19:25:34.66322',NULL,'COS','OPEN','DOMECRK','SRID=4326;POINT (-120.7893375 50.1035589)'),
	 ('23-007004','There is an elk with a large chunk of meat missing from its side with hide hanging. The elk has been around for 2-3 days.','Daren Douglas','1234  Oak Bay Avenue','daren@shaw.ca','403-559-1234',NULL,NULL,'1990 Oak Bay Avenue',NULL,'2023-01-02 09:12:00','2023-01-05 09:12:00','Victoria Golf Club','FLYWAY','2023-07-26 19:25:34.66322','FLYWAY','2023-07-26 19:25:34.66322','OTHER','COS','OPEN','HANSARDU','SRID=4326;POINT (0 0)'),
	 ('23-007005','Calling to report a black bear getting into the garbage on a regular basis. Also wanted to confirm that residents of the trailer home park could call to report sightings themselves','Phoebe','437 Fake St','tester@gmail.com','250-556-1234',NULL,NULL,'644 Pine Street',NULL,'2022-12-19 08:51:00','2023-01-12 09:12:00',NULL,'FLYWAY','2023-07-26 19:25:34.66322','FLYWAY','2023-07-26 19:25:34.66322','COS','COS','OPEN','BDNSTLK','SRID=4326;POINT (0 0)'),
	 ('23-007006','test2','Chris','1264 Disco Rd.','test@test.ca','(250)-555-3425','(250)-555-3425','(250)-555-3425',NULL,'detail_text','2023-02-22 00:00:00','2023-02-22 00:00:00','other text','FLYWAY','2023-07-26 19:25:34.66322','FLYWAY','2023-07-26 19:25:34.66322',NULL,'COS','OPEN','FINMORE','SRID=4326;POINT (-127.4810142 50.4217838)'),
	 ('23-007007','COM was walking their dog near Douglas park – observed a cougar near Heather st. Cougar fled COM, deeper into bushes  LVM CO Ford Briefed Sgt Gravel','Wanda','434 Fake St',NULL,'250-554-1234','250-554-1235','250-554-1236','Keats Campground','detailed text 3','2022-12-25 09:00:00','2023-01-09 09:12:00',NULL,'FLYWAY','2023-07-26 19:25:34.66322','FLYWAY','2023-07-26 19:25:34.66322',NULL,'COS','OPEN','GISCOME','SRID=4326;POINT (0 0)'),
	 ('23-007008','Caller reporting a young deer that has an injured back leg. Caller said it has a bent back leg and it using some weight on it.','Arnold','438 Fake St',NULL,NULL,NULL,NULL,'3087 Hammond Bay Road',NULL,'2022-12-17 08:48:00','2023-01-13 09:12:00',NULL,'FLYWAY','2023-07-26 19:25:34.66322','FLYWAY','2023-07-26 19:25:34.66322','DFO','COS','OPEN','CLUCLZLK','SRID=4326;POINT (0 0)'),
	 ('23-007009','On Mar 30, 2023 at 1245 hrs I observed Lean Bean Miller''s truck (see photo) hauling a load of poultry slaughter waste along Doran Rd heading north to Hillbank Rd. I have followed this truck in past from the Island Farmhouse Poultry facility to 4035 Hillbank Road and can attest that this is the route this truck takes to dump its loads of slaughter waste. Last month both Island Farmhouse Poultry Ltd. and GT Farms were told by the Ministry to ''Immediately cease disposing of any processing waste that comes from poultry not reared, kept or slaughtered at Miller properties.'' The most recent Ministry Inspection reports, UA202814 and AG144737, both stated that this unauthorized waste disposal must be ceased immediately. Its time for the Ministry to involve the Conservation Officer Service and to start taking regulations enforcement seriously. ','Dalton Campbell','1234 Doran Road, Cobble Hill, BC V0R 1L5 ','dalton.campbell@shaw.ca','250-743-1331',NULL,NULL,'3550 Watson Ave','In a Van down by the River','2023-03-29 07:24:00','2023-03-29 07:24:00','Caller','FLYWAY','2023-07-26 19:25:34.66322','FLYWAY','2023-07-26 19:25:34.66322','OTHER','COS','OPEN','HANSARDU','SRID=4326;POINT (-127.4810142 50.4217838)')
     ON CONFLICT DO NOTHING;
	 
