-- Thanos snap to update 1/8 of the COS test data to BC Parks
-----------------------

UPDATE complaint
SET owned_by_agency_code = 'PARKS'
WHERE CAST(SUBSTRING(complaint_identifier FROM 4 FOR 6) AS INTEGER) % 8 = 0
AND owned_by_agency_code = 'COS';

---------------------
-- These ones are part of our Cypress Tests and should be saved
---------------------
UPDATE complaint
SET owned_by_agency_code = 'COS'
WHERE complaint_identifier IN ('23-031744', '23-006888', '23-032456');

---------------------
-- Assign offiers with no office or agency to CEEB
---------------------
UPDATE officer
SET agency_code = 'EPO'
WHERE office_guid is null
AND agency_code is null;

---------------------
-- Overwrite all referred email addresses in dev and test to avoid accidents
---------------------
UPDATE email_reference
SET email_address = 'ceds@gov.bc.ca'
WHERE true;


---------------------
-- Enable referrals in dev/test for all users
---------------------

UPDATE feature_agency_xref
SET active_ind = 'Y'
WHERE feature_code = 'COMPREF';

---------------------
-- Enable collaboration in dev/test for all users
---------------------

UPDATE feature_agency_xref
SET active_ind = 'Y'
WHERE feature_code = 'COMPCOLLAB';

---------------------
-- Disable referral emails in dev and test for all users
---------------------

UPDATE feature_agency_xref
SET active_ind = 'N'
WHERE feature_code = 'REFEMAIL';

---------------------
-- Disable collaborator emails in dev/test for all users
---------------------

UPDATE feature_agency_xref
SET active_ind = 'N'
WHERE feature_code = 'COLEMAIL';

---------------------
-- Disable sector view in dev/test for all users
---------------------

UPDATE feature_agency_xref
SET active_ind = 'N'
WHERE feature_code = 'SECTORVIEW';

-----------------------
-- Default users with a null agency to COS 
-- This really only affects the Dev environment as everyone in test has already been set
-- This may cause some odd display issues if this script conflicts with a role set in CSS
-- In the event of mismatch - just update the user in CSS to be the desired role
-----------------------
UPDATE officer 
SET agency_code = 'COS'
WHERE agency_code is null;

---------------------
-- Update complaint_type_code for test data
---------------------

UPDATE complaint c1 SET complaint_type_code = 
CASE WHEN a.allegation_complaint_guid IS NOT NULL THEN 'ERS'
	 WHEN hc.hwcr_complaint_guid IS NOT NULL THEN 'HWCR'
	 WHEN gc.gir_complaint_guid IS NOT NULL THEN 'GIR'
END
FROM complaint c2
LEFT JOIN allegation_complaint a ON c2.complaint_identifier = a.complaint_identifier
LEFT JOIN hwcr_complaint hc ON c2.complaint_identifier = hc.complaint_identifier
LEFT JOIN gir_complaint gc ON c2.complaint_identifier = gc.complaint_identifier
WHERE c1.complaint_identifier = c2.complaint_identifier;

UPDATE complaint SET complaint_type_code = 'HWCR' WHERE complaint_identifier = '23-007000';